// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmVideo,
  VmFile 
} from '@vime/core';

import { define } from '../lib';


define('vm-video', VmVideo);
define('vm-file', VmFile);


export interface VideoProps extends JSX.VmVideo, HTMLAttributes<HTMLVmVideoElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmVideoElement, VideoProps>(
  'vm-video',
  new Set(['willAttach','hasCustomTextManager','crossOrigin','preload','poster','controlsList','autoPiP','disablePiP','disableRemotePlayback','mediaTitle']),
);
